    false,nt"url": null,nt"notes": "This data set contains the 1996-2001 era
    or land cover change classifications of the SE Atlantic, zone 55 and zone 58. This
    imagery was collected as part of the Multi-Resolution Land Characteristics program
    in a multi-agency effort to provide baseline multi-scale environmental characteristics
    and to monitor environmental change. This data set utilized full or partial Landsat
    5 and 7 Thematic Mapper and Enhanced Thematic Mapper scenes which were analyzed
